  null,\n\t\"notes\": \"The data set contains receipts of tuna destined for canning,
  from both domestic and imported sources, at cannery locations within the 50 states,
  Puerto Rico, and American Samoa.  Data are available from 1979 to present with new
  data appended monthly.  Data elements include species, product condition, flag of
  catcher vessel, ocean area, gear type, and trip dates (domestic purse seine).  Non
  summarized data are considered confidential.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
